  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Red Rock
  Lakes NWR outlines Refuge accomplishments during the 1982 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. The report
  includes a planning section which discusses management planning and public participation.
  Refuge administration is outlined; information about personnel, funding, safety,
  and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, grasslands, grazing, fire management, and water rights. The wildlife
  section of the report discusses endangered and threatened species, waterfowl, marsh
  birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources, animal
  control, and marking and bird banding. The public uses of the Refuge described in
  this report include hunting, fishing, wildlife observation, outdoor recreation,
  and law enforcement. The equipment and facilities section of the report provides
  information about new construction, rehabilitation, major maintenance, equipment
  replacement, communication systems, computer systems, and energy conservation. Cooperative
  programs and items of interest are provided at the end.\",\n\t\"license_title\":
